import React from 'react';
import { Background } from '../../molecules'

export const AmazingWorldOfVi = () => {
    let backgroundUrl = require('../../../assets/images/amazingWorldOfVim.png');
    return (
        <Background background={backgroundUrl}>
            <div>
                <h1>Welcome</h1>
            </div>
        </Background>
    )
}
